--
-- Table structure for table `wartungsmitarbeiter`
--

DROP TABLE IF EXISTS `wartungsmitarbeiter`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `wartungsmitarbeiter` (
  `erfassungsbenutzer` int(10) unsigned DEFAULT NULL,
  `erfassungsdatum` datetime DEFAULT NULL,
  `aenderungsbenutzer` int(10) unsigned DEFAULT NULL,
  `aenderungsdatum` datetime DEFAULT NULL,
  `id` int(10) unsigned NOT NULL COMMENT 'Mehrmals pro Wartung möglich',
  `fk_wartung` int(10) unsigned NOT NULL COMMENT 'Wartung',
  `fk_benutzer` int(10) unsigned DEFAULT NULL COMMENT 'Wartungsmitarbeiter',
  `stunden` double DEFAULT NULL COMMENT 'Dauer des Einsatzes, Zeitaufwand',
  `fk_herstellerlieferant` int(10) unsigned DEFAULT NULL COMMENT 'Beauftragte Firma (Lieferant, oder Dientsleister)',
  `bemerkung` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'z.B. Familienname vom Monteur der externen Firma',
  PRIMARY KEY (`id`),
  KEY `FK_wartungsmitarbeiter_wartung` (`fk_wartung`),
  KEY `FK_wartungsmitarbeiter_benutzer` (`fk_benutzer`),
  KEY `FK_wartungsmitarbeiter_herstellerlieferant` (`fk_herstellerlieferant`),
  CONSTRAINT `FK_wartungsmitarbeiter_benutzer` FOREIGN KEY (`fk_benutzer`) REFERENCES `benutzer` (`id`),
  CONSTRAINT `FK_wartungsmitarbeiter_herstellerlieferant` FOREIGN KEY (`fk_herstellerlieferant`) REFERENCES `herstellerlieferant` (`id`),
  CONSTRAINT `FK_wartungsmitarbeiter_wartung` FOREIGN KEY (`fk_wartung`) REFERENCES `wartung` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC;
/*!40101 SET character_set_client = @saved_cs_client */;

